pub enum Architecture {

    /// x86-64.
    X64,

    /// Aarch64 (ARM64).
    Aarch64,
}

pub enum InlineBreakpointType {

    /// A middleware invocation breakpoint.
    Middleware,
}

pub enum ExceptionCode {

    /// An `unreachable` opcode was executed.
    Unreachable = ,

    /// Call indirect incorrect signature trap.
    IncorrectCallIndirectSignature = ,

    /// Memory out of bounds trap.
    MemoryOutOfBounds = ,

    /// Call indirect out of bounds trap.
    CallIndirectOOB = ,

    /// An arithmetic exception, e.g. divided by zero.
    IllegalArithmetic = ,

    /// Misaligned atomic access trap.
    MisalignedAtomicAccess = ,
}

pub enum InvalidFileType {

    /// Given cache header slice does not match the expected size of an `ArtifactHeader`
    InvalidSize,

    /// Given cache header slice does not contain the expected magic bytes
    InvalidMagic,
}

pub enum Error {

    /// An IO error while reading/writing a cache binary.
    IoError(io::Error),

    /// An error deserializing bytes into a cache data structure.
    DeserializeError(String),

    /// An error serializing bytes from a cache data structure.
    SerializeError(String),

    /// An undefined caching error with a message.
    Unknown(String),

    /// An invalid cache binary given.
    InvalidFile(InvalidFileType),

    /// The cached binary has been invalidated.
    InvalidatedCache,

    /// The current backend does not support caching.
    UnsupportedBackend(String),
}

pub enum Event<'a, 'b> {

    /// An internal event created by the parser used to provide hooks during code generation.
    Internal(InternalEvent),

    /// An event generated by parsing a wasm operator
    Wasm(&'b Operator),

    /// An event generated by parsing a wasm operator that contains an owned `Operator`
    WasmOwned(Operator),
}

pub enum InternalEvent {

    /// A function parse is about to begin.
    FunctionBegin(u32),

    /// A function parsing has just completed.
    FunctionEnd,

    /// A breakpoint emitted during parsing.
    Breakpoint(BreakpointHandler),

    /// Indicates setting an internal field.
    SetInternal(u32),

    /// Indicates getting an internal field.
    GetInternal(u32),
}

pub enum CompileError {

    /// A validation error containing an error message.
    ValidationError {
        /// An error message.
        msg: String,
    },

    /// A internal error containing an error message.
    InternalError {
        /// An error message.
        msg: String,
    },
}

pub enum LinkError {

    /// The type of the provided import does not match the expected type.
    IncorrectImportType {
        /// Namespace.
        namespace: String,
        /// Name.
        name: String,
        /// Expected.
        expected: String,
        /// Found.
        found: String,
    },

    /// The signature of the provided import does not match the expected signature.
    IncorrectImportSignature {
        /// Namespace.
        namespace: String,
        /// Name.
        name: String,
        /// Expected.
        expected: FuncSig,
        /// Found.
        found: FuncSig,
    },

    /// An expected import was not provided.
    ImportNotFound {
        /// Namespace.
        namespace: String,
        /// Name.
        name: String,
    },

    /// The memory descriptor provided does not match the expected descriptor.
    IncorrectMemoryDescriptor {
        /// Namespace.
        namespace: String,
        /// Name.
        name: String,
        /// Expected.
        expected: MemoryDescriptor,
        /// Found.
        found: MemoryDescriptor,
    },

    /// The table descriptor provided does not match the expected descriptor.
    IncorrectTableDescriptor {
        /// Namespace.
        namespace: String,
        /// Name.
        name: String,
        /// Expected.
        expected: TableDescriptor,
        /// Found.
        found: TableDescriptor,
    },

    /// The global descriptor provided does not match the expected descriptor.
    IncorrectGlobalDescriptor {
        /// Namespace.
        namespace: String,
        /// Name.
        name: String,
        /// Expected.
        expected: GlobalDescriptor,
        /// Found.
        found: GlobalDescriptor,
    },

    /// A generic error with a message.
    Generic {
        /// Error message.
        message: String,
    },
}

pub enum InvokeError {

    /// Indicates an exceptional circumstance such as a bug in Wasmer (please file an issue!)
    /// or a hardware failure.
    FailedWithNoError,

    /// Indicates that a trap occurred that is not known to Wasmer.
    UnknownTrap {
        /// The address that the trap occurred at.
        address: usize,
        /// The name of the signal.
        signal: &'static str,
    },

    /// A trap that Wasmer knows about occurred.
    TrapCode {
        /// The type of exception.
        code: ExceptionCode,
        /// Where in the Wasm file this trap orginated from.
        srcloc: u32,
    },

    /// A trap occurred that Wasmer knows about but it had a trap code that
    /// we weren't expecting or that we do not handle.  This error may be backend-specific.
    UnknownTrapCode {
        /// The trap code we saw but did not recognize.
        trap_code: String,
        /// Where in the Wasm file this trap orginated from.
        srcloc: u32,
    },

    /// An "early trap" occurred.  TODO: document this properly
    EarlyTrap(Box<RuntimeError>),

    /// Indicates that a breakpoint was hit. The inner value is dependent upon
    /// the middleware or backend being used.
    Breakpoint(Box<RuntimeError>),
}

pub enum RuntimeError {

    /// An error relating to the invocation of a Wasm function.
    InvokeError(InvokeError),

    /// A metering triggered error value.
    ///
    /// An error of this type indicates that it was returned by the metering system.
    Metering(Box<Any + Send>),

    /// A frozen state of Wasm used to pause and resume execution.  Not strictly an
    /// "error", but this happens while executing and therefore is a `RuntimeError`
    /// from the persective of the caller that expected the code to fully execute.
    InstanceImage(Box<Any + Send>),

    /// A user triggered error value.
    ///
    /// An error returned from a host function.
    User(Box<Any + Send>),
}

pub enum ResolveError {

    /// Found signature did not match expected signature.
    Signature {
        /// Expected `FuncSig`.
        expected: FuncSig,
        /// Found type.
        found: Vec<Type>,
    },

    /// Export not found.
    ExportNotFound {
        /// Name.
        name: String,
    },

    /// Export found with the wrong type.
    ExportWrongType {
        /// Name.
        name: String,
    },
}

pub enum CallError {

    /// An error occured resolving the functions name or types.
    Resolve(ResolveError),

    /// A runtime error occurred during the function call.
    Runtime(RuntimeError),
}

pub enum CreationError {

    /// Unable to create memory error.
    UnableToCreateMemory,

    /// Unable to create table error.
    UnableToCreateTable,

    /// Invalid descriptor error with message.
    InvalidDescriptor(String),
}

pub enum Error {

    /// Compile error.
    CompileError(CompileError),

    /// Link errors.
    LinkError(Vec<LinkError>),

    /// Runtime error.
    RuntimeError(RuntimeError),

    /// Resolve error.
    ResolveError(ResolveError),

    /// Call error.
    CallError(CallError),

    /// Creation error.
    CreationError(CreationError),
}

pub enum GrowError {

    /// Error growing memory.
    MemoryGrowError,

    /// Error growing table.
    TableGrowError,

    /// Max pages were exceeded.
    ExceededMaxPages(PageError),

    /// Max pages for memory were exceeded.
    ExceededMaxPagesForMemory(usize, usize),

    /// Error protecting memory.
    CouldNotProtectMemory(MemoryProtectionError),

    /// Error creating memory.
    CouldNotCreateMemory(MemoryCreationError),
}

pub enum PageError {

    /// Max pages were exceeded error.
    ExceededMaxPages(usize, usize, usize),
}

pub enum MemoryCreationError {

    /// Allocation of virtual memory failed error.
    VirtualMemoryAllocationFailed(usize, String),

    /// Error creating memory from file.
    CouldNotCreateMemoryFromFile(std::io::Error),
}

pub enum MemoryProtectionError {

    /// Protection failed error.
    ProtectionFailed(usize, usize, String),
}

pub enum ParseError {

    /// Error reading binary.
    BinaryReadError,
}

pub enum Context {

    /// External context include a mutable pointer to `Ctx`.
    External(*mut vm::Ctx),

    /// External context with an environment include a mutable pointer
    /// to `Ctx` and an optional non-null pointer to `FuncEnv`.
    ExternalWithEnv(*mut vm::Ctx, Option<NonNull<vm::FuncEnv>>),

    /// Internal context.
    Internal,
}

pub enum Export {

    /// Function export.
    Function {
        /// A pointer to a function.
        func: FuncPointer,
        /// A kind of context.
        ctx: Context,
        /// The signature of the function.
        signature: Arc<FuncSig>,
    },

    /// Memory export.
    Memory(Memory),

    /// Table export.
    Table(Table),

    /// Global export.
    Global(Global),
}

