    /// A dynamic memory.
    Dynamic,

    /// A static memory.
    Static,

    /// A shared static memory.
    SharedStatic,
}

pub enum ExportIndex {

    /// Function export index. [`FuncIndex`] is a type-safe handle referring to
    /// a Wasm function.
    Func(FuncIndex),

    /// Memory export index. [`MemoryIndex`] is a type-safe handle referring to
