    Table(TableIndex),
}

pub enum LoadError {

    /// Parse error.
    Parse(String),

    /// Code generation error.
    Codegen(String),
}

pub enum Protect {

    /// Read/write/exec allowed.
    None,

    /// Read only.
    Read,

    /// Read/write only.
    ReadWrite,

    /// Read/exec only.
    ReadExec,
}

pub enum TableAccessError {

    /// The index wasn't valid, so no element could be accessed.
    IndexError,

    #[allow(dead_code)]
    /// The type of the table was incorrect, so no element could be accessed.
    TypeError,
}

pub enum TableStorage {

    /// This is intended to be a caller-checked Anyfunc.
    Anyfunc(Box<AnyfuncTable>),
}

pub enum Type {

    /// The `i32` type.
    I32,

    /// The `i64` type.
    I64,

    /// The `f32` type.
    F32,

    /// The `f64` type.
    F64,

    /// The `v128` type.
    V128,
}

pub enum Value {

    /// The `i32` type.
    I32(i32),

    /// The `i64` type.
    I64(i64),

    /// The `f32` type.
