pub enum Initializer {

    /// Corresponds to a `const.*` instruction.
    Const(Value),

    /// Corresponds to a `get_global` instruction.
    GetGlobal(ImportedGlobalIndex),
}

pub enum LocalOrImport<T> where T: LocalImport {

    /// Local.
